import React, { Component } from 'react';
import TodoItem from './TodoItem';

class TodoList extends Component {
	render() {
		const todos = this.state.todos.map((t) => <TodoItem key={t._id} {...t} />);
		return <h1>Todo List</h1>;
	}
}

export default TodoList;
